async def request_body_to_args(
    required_params: List[ModelField],
    received_body: Optional[Union[Dict[str, Any], FormData]],
) -> Tuple[Dict[str, Any], List[ErrorWrapper]]:
    values = {}
    errors = []
    for field in required_params:
        value = None
        if received_body is not None:
            field_info = get_field_info(field)
            shape = field_info.shape
            field_name = field.field_info.resolve_annotations()['alias']
            if shape in sequence_shapes and isinstance(received_body, FormData):
                value = received_body.getlist(field_name)
            else:
                value = received_body.get(field_name)

            if value is None or (value == "" and field.required):
                errors.append(ErrorWrapper(MissingError(), loc=("body", field_name)))
            else:
                if shape in sequence_shapes and isinstance(value, sequence_types):
                    values[field.name] = value
                else:
                    v_, errors_ = field.validate(value, values, loc=("body", field_name))
                    if isinstance(errors_, ErrorWrapper):
                        errors.append(errors_)
                    elif isinstance(errors_, list):
                        errors.extend(errors_)
                    else:
                        values[field.name] = v_

    return values, errors
